      <div>
        <h1>login</h1>
        <form>
          <div className="form-group">
            <label htmlFor="" />
            Username
            <input type="text" className="form-control" />
          </div>
          <div className="form-group">
            <label htmlFor="" />
            Passwort
            <input type="text" className="form-control" />
          </div>
        </form>
      </div>
    );
  }
}

export default LoginForm;
